import ExpenseItem from './ExpenseItem';
import Card from './Card.js';
import './Card.css';

function Expenses(props) {
    return (
        <Card className='card'>
            <ExpenseItem
                expenseTitle={props.items[0].title}
                price={props.items[0].amount}
                date={props.items[0].date}>
            </ExpenseItem>
            <ExpenseItem
                expenseTitle={props.items[1].title}
                price={props.items[1].amount}
                date={props.items[1].date}>
            </ExpenseItem>
            <ExpenseItem
                expenseTitle={props.items[2].title}
                price={props.items[2].amount}
                date={props.items[2].date}>
            </ExpenseItem>
            <ExpenseItem
                expenseTitle={props.items[3].title}
                price={props.items[3].amount}
                date={props.items[3].date}>
            </ExpenseItem>
        </Card>
    )
};

export default Expenses;
